import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import Accordion from "@mui/material/Accordion";
import AccordionSummary from "@mui/material/AccordionSummary";
import AccordionDetails from "@mui/material/AccordionDetails";
import { useState } from "react";

function RandomArray() {
  const [randomArray,setRandomArray] = useState([]);

  const dataTypes = [Number,String,Boolean,Object,Array,null,undefined];
  const getRandomElement = (dataType) => {
    switch(dataType) {
      case Number:
        return Math.floor(Math.random() * 100)+1; // Generate a random number between 0 and 100
        case String:
          return Math.random().toString(36).substring(7); // Generate a random string
        case Boolean:
          return Math.random() < 0.5; // Generate a random boolean
        case Object:
          return { key: Math.random().toString(36).substring(7) }; // Generate a random object
        case Array:
          return [1, 2, 3]; // Generate a sample array
        case null:
          return null;
        case undefined:
          return undefined;
        default:
          return null;
    }

  }

  const generateRandomMixedArray = (length) => {
    let newArray = [];
    for(let i = 0; i< length; i++) {
      const randomDataTypeIndex = Math.floor(Math.random() * dataTypes.length);
      const randomDataType = dataTypes[randomDataTypeIndex];
      const randomElement = getRandomElement(randomDataType);
      newArray.push(randomElement);
      console.log(randomArray);

    }
    setRandomArray(newArray);
  };







  return (
    <>
      <Box sx={{ bgcolor: "white" }}>
        <Accordion>
          <AccordionSummary>
            <Button variant="contained" onClick={() => generateRandomMixedArray(5)}>
              Generate Random Array?
            </Button>
          </AccordionSummary>
          <AccordionDetails>
          <Typography>
            {/* Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
            malesuada lacus ex, sit amet blandit leo lobortis eget. */}
          </Typography>
          </AccordionDetails>
        </Accordion>
      </Box>
    </>
  );
}
export default RandomArray;
